			<div class="stl_view">
				<div class="stl_05 stl_06">
					<div class="stl_01" style="top: 11.6428em; left:16.0939em;"><span class="stl_07 stl_08">歡迎來到國立臺灣科學教育<span class="stl_09">館</span></span><span class="stl_10">~ &nbsp;</span></div>
					<div class="stl_01" style="top: 22.8669em; left:7.4189em;"><span class="stl_11">作為一個國立科學博物館，科教館內的常設展區內涵蓋了從生命科學、物理、化學、數學與地球科學等豐富的展覽內容， &nbsp;</span></div>
					<div class="stl_01" style="top: 25.4121em; left:7.4189em;"><span class="stl_11">也不斷與國內外博物館或策展單位合作策畫展出最新的科學展覽。此外科教館也是全國唯一一座國立科學教育中心，具 &nbsp;</span></div>
					<div class="stl_01" style="top: 27.9574em; left:7.4189em;"><span class="stl_11">備科普資源中心及設備齊全的科學實驗室，並持續策畫各式各樣的科學課程與營隊等，透過動手操作，帶給大家新鮮有 &nbsp;</span></div>
					<div class="stl_01" style="top: 30.5027em; left:7.4189em;"><span class="stl_11">趣的科學活動體驗，更能深植探究科學的能力。 &nbsp;</span></div>
					<div class="stl_01" style="top: 35.5472em; left:7.4189em;"><span class="stl_11">科教館期以兼顧各年齡層民眾的視角規劃各類型展覽及科學課程及各類活動，期望全民都能學科學、玩科學，進而愛上 &nbsp;</span></div>
					<div class="stl_01" style="top: 38.0924em; left:7.4189em;"><span class="stl_11">科學！ &nbsp;</span></div>
					<div class="stl_01" style="top: 43.1369em; left:7.4189em;"><a href="http://www.ntsec.gov.tw/" target="_blank"><span class="stl_11 stl_09">科教館網站<span class="stl_08">：</span></span></a><a href="http://www.ntsec.gov.tw/" target="_blank"><span class="stl_12 stl_09">www.ntsec.g<span class="stl_08">ov.tw &nbsp;</span></span></a></div>
